using System;
using System.Linq;
using System.Collections.Generic;

namespace Olymp
{
	public static class Itmo
	{
		public static void Main()
		{
			char[] Alphabet = Enumerable.Range('А', 'Я' - 'А' + 1).Select(i => (char)i).ToArray();
			int DYPLOM = HashFunction("ДИПЛОМ");
			Console.WriteLine("\"ДИПЛОМ\" hash code : " + DYPLOM);
			int Sum = 0;
			
			for (int a = 0; a < Alphabet.Length; a++)
				for (int b = 0; b < Alphabet.Length; b++)
					for (int c = 0; c < Alphabet.Length; c++)
						for (int d = 0; d < Alphabet.Length; d++)
							for (int e = 0; e < Alphabet.Length; e++)
								for (int f = 0; f < Alphabet.Length; f++)
								{
									string abcdef =
										Alphabet[a].ToString()
										+ Alphabet[b].ToString()
										+ Alphabet[c].ToString()
										+ Alphabet[d].ToString()
										+ Alphabet[e].ToString()
										+ Alphabet[f].ToString();
									if (HashFunction(abcdef) == DYPLOM)
									{
										Console.Write(abcdef + ' ');
										Sum++;
									}
								}
			Console.WriteLine("Finded words count : " + Sum - 1); //Finded words count : 10556
		}
		
		public static IEnumerable<string> GenerateStrings(IEnumerable<char> characters, int length)
		{
			if (length < 1)
				yield return string.Empty;
			
			foreach (char c in characters)
				foreach (string suffix in GenerateStrings(characters, length - 1))
					yield return c + suffix;
		}
		
		public static int HashFunction(string str)
		{
			int c = str.Length - 1;
			int h = str.Length / 2;
			int m = 1;
			int res = 0;
			while (c >= 0)
			{
				res = res + str[c] * m;
				if (c > h)
					m *= 80;
				else
					if (c < h)
						m /= 80;
				
				c -= 1;
			}
			return res;
		}
	}
}

